import React from 'react';
import PostItem from "./PostItem";

const PostList = ({post, title, remove}) => {

    if(!post.length){
        return (
            <h1 style={{textAlign: 'center'}}>
                No posts
            </h1>
        )
    }
    return (
        <div>
            <h1 style={{textAlign: 'center'}}>
                {title}
            </h1>
            {post.map((post, index) =>
                <PostItem remove={remove} number={index+1} post={post} key={post.id}/>
            )}
        </div>
    );
};

export default PostList;
